let {WxComponents, WebHookConstants} =  require('../constants');
let BaseActionContainer              = require('./base/BaseActionContainer');

class ButtonRaised extends BaseActionContainer {

    static init(param) {
        return new ButtonRaised(param);
    }

    constructor(param) {
        super(param);
        this.config = {'type': WxComponents.BUTTON_RAISED};
    }
}

module.exports = ButtonRaised;
